import React from "react";
import style from "./card.module.css"


/* export default function Card(props) {
   return (
      <div className={style.divGeneral}>
         <button className={style.boton} onClick={props.onClose}>X</button>
         <h2 className={style.name} >{props.name}</h2>
         <h2 className={style.species}>{props.species}</h2>
         <h2 className={style.gender}>{props.gender}</h2>
         <img className={style.img} src={props.image} alt="" /> 
      </div>
   );
}
 */

export default function Card(props) {
   return (
     <div className={style.divGeneral}>
       <button className={style.button} onClick={props.onClose}>X</button>
       <img className={style.img} src={props.image} alt="" /> 
       <div className={style.info}>
         <div>
           <h2 className={style.name}>{props.name}</h2>
           <div className={style.species}>{props.species}</div>
         </div>
         <div>
           <div className={style.gender}>{props.gender}</div>
         </div>
       </div>
     </div>
   );
 }
